function CountryInfo(props){

    return (

    <>
    <div>

        {props.data.slice(0,15).map((country, index) => {

            return
            (
                <div key ={index} className="countryInfo">
                <p className="countryName">{props.data.name.common}</p>
                <p>{props.data.area} KM <sup>2</sup> </p>
            </div>
            )

        })}


    </div>
    </>

    )
}



export default CountryInfo;
